import React from 'react';

export function Row(props){
    return (
        <div className='row'>
            {props.children}
        </div>
    )
}

export function Col(props){
    const colStr = 'col-';
    const colClass = props.size + props.col;
    return (
        <div className={colStr}>
            {props.children}
        </div>
    )
}
